vector<int> decode(string s) {
    int cur = 0;
    vector<int> v;
    for (char c : s) {
        if (c >= '\\') {
            c--;
        }
        int x = (c - '#');
        cur += x / 9 - 7;
        v.push_back(cur);
        cur += x % 9 - 7;
        v.push_back(cur);
    }
    return v;
}

